import { Typography } from '@material-ui/core';
import React from 'react';
import useStyles from './styles';

const Auth = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Typography variant="h5" color="primary">
        Sign In
      </Typography>
    </div>
  );
};

export default Auth;
